import styled from 'styled-components';

const Layout = styled.div`
  width: 100%;
  height: 100%;

  display: grid;
  grid-template-rows: 1fr;
  grid-template-columns: 2fr 5fr 2fr;
`;
const Header = () => {
  return (
    <div>
      <div>Logo</div>
      <h1>WELCOME TO MY HOME</h1>
      <div>유저정보</div>
    </div>
  );
};

export default Header;
